DROP DATABASE IF EXISTS `mining_pool`;
CREATE DATABASE IF NOT EXISTS `mining_pool` CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci;
USE `mining_pool`;

CREATE TABLE `connection_settings` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `config_key` VARCHAR(64) NOT NULL,
  `config_value` TEXT NOT NULL,
  `created_at` TIMESTAMP DEFAULT CURRENT_TIMESTAMP
) ENGINE=InnoDB;



CREATE TABLE `users` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `username` VARCHAR(64) UNIQUE NOT NULL,
  `email` VARCHAR(128) UNIQUE,
  `role` ENUM('miner','admin','viewer') DEFAULT 'miner',
  `password_hash` CHAR(64) NOT NULL,
  `status` ENUM('active','suspended','deleted') DEFAULT 'active',
  `created_at` TIMESTAMP DEFAULT CURRENT_TIMESTAMP
) ENGINE=InnoDB;


CREATE TABLE `wallets` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `user_id` INT NOT NULL,
  `coin` VARCHAR(10) NOT NULL,
  `address` VARCHAR(128) NOT NULL,
  `label` VARCHAR(64),
  `is_default` TINYINT(1) DEFAULT 0,
  `created_at` TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  INDEX (`user_id`)
) ENGINE=InnoDB;


CREATE TABLE `coins` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `symbol` VARCHAR(10) UNIQUE NOT NULL,
  `name` VARCHAR(64) NOT NULL,
  `network` VARCHAR(64) NOT NULL,
  `block_time_s` INT NOT NULL,
  `block_reward` DECIMAL(18,8) NOT NULL,
  `halving_interval_blocks` INT
) ENGINE=InnoDB;


CREATE TABLE `pools` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `name` VARCHAR(64) NOT NULL,
  `coin` VARCHAR(10) NOT NULL,
  `stratum_host` VARCHAR(128) NOT NULL,
  `stratum_port` INT NOT NULL,
  `payout_scheme` ENUM('PPLNS','PPS','FPPS') DEFAULT 'PPLNS',
  `fee_pct` DECIMAL(5,2) DEFAULT 1.50,
  `min_payout` DECIMAL(18,8) DEFAULT 0.00100000,
  `status` ENUM('online','degraded','offline') DEFAULT 'online'
) ENGINE=InnoDB;


CREATE TABLE `workers` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `user_id` INT NOT NULL,
  `name` VARCHAR(64) NOT NULL,
  `online` TINYINT(1) DEFAULT 0,
  `last_seen` DATETIME,
  `current_hashrate_th` DECIMAL(18,6) DEFAULT 0,
  `lifetime_shares` BIGINT DEFAULT 0,
  `stale_shares` BIGINT DEFAULT 0,
  `rejected_shares` BIGINT DEFAULT 0,
  INDEX (`user_id`)
) ENGINE=InnoDB;


CREATE TABLE `asic_models` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `vendor` VARCHAR(64) NOT NULL,
  `model` VARCHAR(64) NOT NULL,
  `algo` VARCHAR(32) NOT NULL,
  `hash_rate_th_s` DECIMAL(18,3) NOT NULL,
  `power_w` INT NOT NULL,
  `notes` TEXT
) ENGINE=InnoDB;


CREATE TABLE `firmware_versions` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `model_id` INT NOT NULL,
  `version` VARCHAR(32) NOT NULL,
  `release_date` DATE,
  `changelog` TEXT
) ENGINE=InnoDB;


CREATE TABLE `asic_devices` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `worker_id` INT NOT NULL,
  `model_id` INT NOT NULL,
  `serial_number` VARCHAR(64) UNIQUE NOT NULL,
  `firmware_id` INT,
  `api_ip` VARCHAR(64),
  `rack` VARCHAR(16),
  `slot` VARCHAR(16),
  `status` ENUM('idle','mining','error','maintenance') DEFAULT 'idle',
  `temperature_c` DECIMAL(5,2) DEFAULT 25.0,
  `fan_rpm` INT DEFAULT 3000,
  `power_w` INT DEFAULT 0,
  `voltage_v` DECIMAL(6,2) DEFAULT 12.0,
  `frequency_mhz` DECIMAL(8,2) DEFAULT 500.00,
  `created_at` TIMESTAMP DEFAULT CURRENT_TIMESTAMP
) ENGINE=InnoDB;


CREATE TABLE `asic_settings` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `device_id` INT NOT NULL,
  `core_voltage_v` DECIMAL(6,3) DEFAULT 12.000,
  `fan_min_pct` INT DEFAULT 30,
  `fan_max_pct` INT DEFAULT 100,
  `freq_mhz` DECIMAL(8,2) DEFAULT 550.00,
  `power_limit_w` INT DEFAULT 3500,
  `autotune` TINYINT(1) DEFAULT 1,
  `sleep_schedule_json` JSON,
  `last_applied_at` DATETIME
) ENGINE=InnoDB;


CREATE TABLE `stratum_sessions` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `worker_id` INT NOT NULL,
  `pool_id` INT NOT NULL,
  `session_uuid` CHAR(36) NOT NULL,
  `client_version` VARCHAR(64),
  `remote_ip` VARCHAR(64),
  `difficulty` DOUBLE DEFAULT 1024,
  `started_at` DATETIME,
  `ended_at` DATETIME
) ENGINE=InnoDB;


CREATE TABLE `shares` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `session_id` BIGINT NOT NULL,
  `ts` DATETIME NOT NULL,
  `nonce` VARCHAR(32) NOT NULL,
  `is_stale` TINYINT(1) DEFAULT 0,
  `difficulty` DOUBLE DEFAULT 1024
) ENGINE=InnoDB;


CREATE TABLE `blocks` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `coin_id` INT NOT NULL,
  `pool_id` INT NOT NULL,
  `height` BIGINT NOT NULL,
  `hash` CHAR(64) NOT NULL,
  `found_by_worker` INT,
  `ts` DATETIME NOT NULL,
  `reward` DECIMAL(18,8) NOT NULL,
  `confirmations` INT DEFAULT 0,
  `status` ENUM('pending','confirmed','orphaned') DEFAULT 'pending'
) ENGINE=InnoDB;


CREATE TABLE `network_stats` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `coin_id` INT NOT NULL,
  `height` BIGINT NOT NULL,
  `difficulty` DOUBLE NOT NULL,
  `network_hashrate_th` DOUBLE NOT NULL,
  `price_usd` DECIMAL(18,2) DEFAULT 0.00,
  `ts` DATETIME NOT NULL
) ENGINE=InnoDB;


CREATE TABLE `hashrate_samples` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `worker_id` INT NOT NULL,
  `ts` DATETIME NOT NULL,
  `hr_th` DECIMAL(18,6) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE `payouts` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `user_id` INT NOT NULL,
  `coin_id` INT NOT NULL,
  `amount` DECIMAL(18,8) NOT NULL,
  `fee` DECIMAL(18,8) DEFAULT 0.00001000,
  `txid` CHAR(64),
  `ts` DATETIME NOT NULL,
  `status` ENUM('queued','sent','failed') DEFAULT 'queued'
) ENGINE=InnoDB;


CREATE TABLE `withdrawals` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `user_id` INT NOT NULL,
  `wallet_id` INT NOT NULL,
  `coin_id` INT NOT NULL,
  `amount` DECIMAL(18,8) NOT NULL,
  `fee` DECIMAL(18,8) DEFAULT 0.00020000,
  `address` VARCHAR(128) NOT NULL,
  `txid` CHAR(64),
  `ts` DATETIME NOT NULL,
  `status` ENUM('pending','processing','sent','failed','cancelled') DEFAULT 'pending'
) ENGINE=InnoDB;


CREATE TABLE `invoices` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `user_id` INT NOT NULL,
  `amount_usd` DECIMAL(18,2) NOT NULL,
  `token` VARCHAR(32) UNIQUE NOT NULL,
  `ts` DATETIME NOT NULL,
  `status` ENUM('pending','paid','expired','cancelled') DEFAULT 'pending'
) ENGINE=InnoDB;


CREATE TABLE `fee_schedule` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `tier_name` VARCHAR(32) NOT NULL,
  `threshold_th` DOUBLE NOT NULL,
  `fee_pct` DECIMAL(5,2) NOT NULL
) ENGINE=InnoDB;


CREATE TABLE `error_logs` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `device_id` INT NOT NULL,
  `ts` DATETIME NOT NULL,
  `severity` ENUM('INFO','WARN','ERROR','CRITICAL') NOT NULL,
  `code` VARCHAR(32) NOT NULL,
  `message` TEXT NOT NULL
) ENGINE=InnoDB;


CREATE TABLE `alerts` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `user_id` INT,
  `type` VARCHAR(64) NOT NULL,
  `content` TEXT NOT NULL,
  `severity` ENUM('low','medium','high','critical') DEFAULT 'low',
  `created_at` DATETIME NOT NULL,
  `read_at` DATETIME
) ENGINE=InnoDB;


CREATE TABLE `maintenance_tasks` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `device_id` INT NOT NULL,
  `assigned_to` VARCHAR(64),
  `description` TEXT,
  `scheduled_for` DATETIME,
  `status` ENUM('open','in_progress','done','cancelled') DEFAULT 'open'
) ENGINE=InnoDB;


CREATE TABLE `api_keys` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `user_id` INT NOT NULL,
  `token` CHAR(40) UNIQUE NOT NULL,
  `scopes` VARCHAR(255) DEFAULT 'read:stats,write:withdraw',
  `is_active` TINYINT(1) DEFAULT 1,
  `created_at` DATETIME NOT NULL
) ENGINE=InnoDB;


CREATE TABLE `promo_codes` (
  `id` INT PRIMARY KEY AUTO_INCREMENT,
  `code` VARCHAR(32) UNIQUE NOT NULL,
  `description` VARCHAR(128),
  `discount_usd` DECIMAL(18,2) DEFAULT 0.00,
  `usage_limit` INT DEFAULT 0,
  `used_count` INT DEFAULT 0,
  `valid_from` DATETIME,
  `valid_to` DATETIME,
  `is_active` TINYINT(1) DEFAULT 1
) ENGINE=InnoDB;


CREATE TABLE `audit_log` (
  `id` BIGINT PRIMARY KEY AUTO_INCREMENT,
  `actor_user_id` INT,
  `action` VARCHAR(64) NOT NULL,
  `target_table` VARCHAR(64),
  `target_id` VARCHAR(64),
  `ts` DATETIME NOT NULL,
  `metadata_json` JSON
) ENGINE=InnoDB;

